import React  from 'react';
import '../styles/TableTitle.css';
function TableTitle () {
  return (
      <div className="container">
        <div className="row">
          <div className="table-title col-2">Profile Image</div>
          <div className="table-title col-2">Name</div>
          <div className="table-title col-2">Phone Number</div>
          <div className="table-title col-2">Email</div>
          <div className="table-title col-2">DOB</div>
          <hr className="rule"></hr>
          </div>
      </div>
  )
}

export default TableTitle;
